0	Мегафон запустил сервис оплаты офлайн-покупок частями	Мегафон запустил в розничной сети сервис оплаты частями Яндекс Сплит	2022-10-28 19:00:00	1
1	ЯндексЕда и Лавка поддержат партнеров в новогодние праздники	Сервисы Яндекс Еда и Лавка выделят более 25 миллион рублей на поддержку партнеров в новогодние праздники дополнительные выплаты получат курьеры и сборщики заказов Об этом говорится в пресс-релизе поступившем 24 декабрь Известиям	2021-12-24 14:00:00	1
2	В ЯндексТакси рассказали о технологиях для снижения аварийности на дорогах	Зимой ситуация на дорогах осложняется для каждого водителя и риск возникновения дорожно-транспортного происшествия (ДТП) возрастает	2021-12-30 17:00:00	1
3	Доход курьеров Яндекса в новогодние праздники вырос до 50 процентов	Доход сотрудничающих с Яндексом курьеров и сборщиков заказов вырос до 50 процентов в новогодние праздники относительно среднего дохода в высокий осенне-зимний сезон Об этом 11 январь Известиям сообщили в пресс-службе компании	2022-01-11 18:00:00	1
4	ФАС и Яндекс заключили мировое соглашение по делу о поисковой выдаче	Федеральная антимонопольная служба (ФАС) Яндекс и заявители по антимонопольному делу заключили мировое соглашение Об этом говорится в заявлении ФАС опубликованном в среду 19 январь в Telegram	2022-01-19 21:00:00	1
5	В Авито оценили договоренность о мировом соглашении с Яндексом	В Авито рассчитывают что Яндекс будет добросовестно исполнять условия мирового соглашения о котором удалось договориться в ходе судебного процесса	2022-01-21 11:00:00	1
6	ЯндексМаркет инвестирует более 270 миллион рублей в рекламу пунктов выдачи заказов	Сервис Яндекс Маркет планирует в 2022 году инвестировать более 270 миллион рублей в продвижение брендированных пунктов выдачи заказов (ПВЗ) сообщили Известиям 21 январь в пресс-службе компании	2022-01-21 14:00:00	1
7	Крупнейшие торговые площадки собрались присоединиться к антимонопольным принципам ФАС	Крупнейшие российские цифровые компании и деловые ассоциации заявили что готовятся присоединились к концепции Принципов взаимодействия участников цифровых рынков которые были утверждены Федеральной антимонопольной службой (ФАС) в 2021 году	2022-02-02 18:00:00	1
8	Киносборочная группа: бизнес призвал снизить налоги на онлайн-контент	Как реализация идеи может отразиться на зрителях	2022-02-02 22:00:00	1
9	К горнолыжным подъемникам на зимних курортах Сочи начали доставлять еду	Заказать еду в ресторанах с доставкой на зимние курорты Сочи стало возможно с помощью Яндекс Еды Сервис привозит заказы на курорты Красной Поляны на высоте 540 м и 960 м а также на Розу Хутор на высотах 560 м и 1170 м	2022-02-03 12:00:00	1
10	ЯндексДоставка занялась междугородней логистикой	Сервис Яндекс Доставка ранее работавший исключительно внутри городов с февраль 2022 года начал помогать компаниям в организации междугородней логистики Об этом сообщается в пресс-релизе поступившем Известиям в пятницу 11 февраля	2022-02-11 21:00:00	1
11	Товарооборот Яндекса в сегменте e-grocery достиг рекордных 575 млрд рублей	Товарооборот Яндекса в сегменте e-grocery по итогам 2021 года достиг рекордных 575 млрд рублей	2022-02-15 19:00:00	1
